import style from "./SearchOptionPrice.module.css";

import SearchOptionUI from "../SearchOptionUI";

const searchItem = [
  "0 ~ $100",
  "$100 ~ $200",
  "$200 ~ $300",
  "$300 ~ $400",
  "$400 ~ $500",
];
function SearchOptionPrice() {
  return <SearchOptionUI checkboxItem={searchItem} />;
}

export default SearchOptionPrice;
